import React from 'react';
import './YouTubeVideo.css';


class YouTubeVideo extends React.Component {
  render() {
    return (

		/*<div className="holder">
			<iframe className="video" src={this.props.link} frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowFullScreen="true"></iframe>
			<h1>{this.props.title}</h1>
		</div>*/
		<div className="holder">
			<img src={this.props.thumbnail} className="video_thumbnail"/>
			<img src="play-icon.jpg" />
			<h1>{this.props.title}</h1>
		</div>
    );
  }
}

export default YouTubeVideo;
